import axios from 'axios'; 

const getTestProduct = () => { 
    console.log("GETTING DATA");
    axios
    .get('https://0d569b81-281f-42aa-b7c8-982eef0cfaa0.mock.pstmn.io/product?id=123456789')
    .then(res => console.log(res.data));
}

export default { 
    getTestProduct, 
}
